import React from 'react'

function DeckOverview({deck = {}}) {
  return (
    <div className='card'>
      <div className="card-body">
        <h3 className="card-title">{deck.name}</h3>
        <p>{deck.description}</p>
      </div>
      
    </div>
  )
}

export default DeckOverview
